Infinite Foundry is 3D digital plant platform that hosts the precise 3D model of the plant obtained from laser scan, called plant digital twin, to provide an easy 3D gamification experience that drives industrial operational efficiency. It works in three simple steps: 
(1) Laser scan the interior of the industrial facility to obtain its 3D precise model including architecture, utilities, production and robotic equipments; 
(2) Connect the 3D plant model to the plant to obtain a 3D real-time animation of the production process for accurate assessment of manufacturing capacity and to understand the root cause of production problems;
(3) Run 3D production and ergonomics optimization scenarios to find the best way to solve manufacturing problems and improve operational efficiency. The virtual scenarios can be validated through virtual reality training where workers go immersively inside the new manufacturing scenarios and execute the new optimized production tasks for efficient implementation of improved production processes.
The 3D gamification technology for production management allows industry to keep plants operating while they are monitored remotely and/or in teleworking. The implementation is very easy, like installing a video game, and the power of having the entire 3D copy of the plant in a computer anywhere unlocks industrial operational efficiencies not possible until now.

Marine Digital GmbH works in the Field of Vessel performance optimization offering the edge hardware and AI technologies to provide fleet insights and reduce the fuel consumption of the vessels. 

We are targeting a set of industry problems:
- Old analog vessel digitalisation without new layer of sensors;
- Intraday Plug-in technology and low-cost version of the digital twin for the short term charters;
- Low traffic volume data streaming, satellite channel cost reduction;
- Online performance monitoring, forecast of the maintenance events and issues for the major onboard equipment units with AI algorithms;
- Monitoring, Forecast and Optimisation of the vessel emissions and fuel consumption through advanced routing based on digital twin and AI Technologies.

AIR6 SYSTEMS, headquartered in Klagenfurt, Austria, is the LEADING MANUFACTURER of high-quality drones for professional applications. These include manual and automated flights for surveying / mapping / measuring, cinematography, agriculture & forestry, inspection / surveillance, disaster response and various industrial tasks.
The group includes AIRBORNE ROBOTICS Ltd. based in London / UK and AIR6 SYSTEMS GmbH in Munich / Germany.

AIR6 SYSTEMS is a supplier of 1) turnkey DRONE SYSTEMS - series production with a high degree of customization (customizing) for special applications and in particular of 2) drones for HEAVY PAYLOADS. The latter allows a variety of professional applications, the simultaneous use of multiple sensors and long flight times.

For MEASUREMENT / MAPPING / MEASURING and CONSTRUCTION PLANING, AIR6 SYSTEMS offers a complete range of drone solutions covering 95% of all currently possible applications, including:
- AIR8 Medium Lifter Drone: LiDAR / Laserscanning, industrial and scientific research;
- AIR6 Allrounder Drone: photogrammetry, mapping, construction supervision, precision measuring in open pit mining, thermal measurement / inspection, etc.
- AIR4 and AIR4 indoor drone

We manufacture top quality products, MADE IN AUSTRIA, which distinguish themselves in any professional segment from competing products, in particular through:
- REDUNDANCY (increased fail-safety through two electronic circuits, important for use in built-up areas and for operating safety case (OSC) requirements);
- FLIGHT PERFORMANCE (payload, time of flight, power reserve, stability);
- OPEN PLATFORM (possibility to mount any sensor or payload);
- CUSTOMIZING (tailor-made systems).
